import React from 'react'

import QnAApprovalViewItem from './QnAApprovalViewItem'

class QnAApprovalView extends React.Component {
  constructor(props) {
    super(props)
    this.state = {}
  }

  render() {
    const {
      props: { needApprovalQnA }
    } = this
    return (
      <div className='qnaApprovalView'>
        <div className='title'>Câu hỏi của bạn:</div>

        <div className='qnaApprovalViewWrapper'>
          {needApprovalQnA.map((qnaItem, index) => (
            <div key={index} className='qnaApprovalViewItem'>
              <QnAApprovalViewItem qnaItem={qnaItem} />
            </div>
          ))}
        </div>
      </div>
    )
  }
}

export default QnAApprovalView
